    goodIndices := []int{}
    for i, variable := range variables {
        a, b, c, m := variable[0], variable[1], variable[2], variable[3]
        if (((a*b)%10) == target) && (c == 1) && (m > target) {
            goodIndices = append(goodIndices, i)
