// Helper function to compute (base^exponent) % mod correctly considering Go's mod behavior
func pow(base, exponent, mod int) int {
    if mod == 1 {
        return 0
    }
    result := 1
    base %= mod
    for exponent > 0 {
        if exponent%2 == 1 {
            result = (result * base) % mod
        }
        exponent >>= 1
        base = (base * base) % mod
    }
    return result
}
